    body {
      display: flex;

      height: 100vh;
      margin: 0;

    }

    button {
      padding: 10px 20px;
      margin-top: 10px;
      font-size: 16px;
      color: #fff;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s;

    #envBtn {
      background-color: #3498db;
    }


    #infoBtn {
      background-color: #e74c3c;
    }
	#checkTools {
      background-color: #e66c3c;
    }

    button:hover {
      background-color: #2980b9;
    }

    #userAgentText {
      padding: 10px;
      margin-top: 10px;
      font-size: 16px;
      border-radius: 5px;
      border: 1px solid #ccc;
      width: 390px;
      text-align: center;
    }
    #obfuscationBtn {
      background-color: #9b59b6;
    }
	.button-container {
    display: flex;
    flex-direction: column;
  }
  </style>
